# coding: utf-8
import sys
import cv2
import numpy as np
from keras import models
import hashlib
import os
import pathlib
import requests
import scipy.fftpack
import re
import base64
import gc

word_model = models.load_model('captcha/model.h5')
img_model = models.load_model('captcha/12306.image.model.h5')
fp = open('captcha/texts.txt', encoding='utf-8')
texts = [text.rstrip('\n') for text in fp]


def _get_text(img, offset=0):
    # 得到图像中的文本部分
    return img[3:22, 120 + offset:177 + offset]

def _get_imgs(img):
    interval = 5
    length = 67
    for x in range(40, img.shape[0] - length, interval + length):
        for y in range(interval, img.shape[1] - length, interval + length):
            yield img[x:x + length, y:y + length]

def get_text(img, offset=0):
    text = _get_text(img, offset)
    text = cv2.cvtColor(text, cv2.COLOR_BGR2GRAY)
    text = text / 255.0
    h, w = text.shape
    text.shape = (1, h, w, 1)
    return text


def base64_to_image(base64_code):
    # base64解码
    img_data = base64.b64decode(base64_code)
    # 转换为np数组
    img_array = np.fromstring(img_data, np.uint8)
    # 转换成opencv可用格式
    img = cv2.imdecode(img_array, cv2.COLOR_RGB2BGR)
    return img

def preprocess_input(x):
    x = x.astype('float32')
    # 我是用cv2来读取的图片，其已经是BGR格式了
    mean = [103.939, 116.779, 123.68]
    x -= mean
    return x


def captcha_predict(b64):
    # 读取并预处理验证码
    img = base64_to_image(b64)
    text = get_text(img)
    imgs = np.array(list(_get_imgs(img)))
    imgs = preprocess_input(imgs)

    # 识别文字
    label = word_model.predict(text)
    label1 = label.argmax()
    text = texts[label1]
    # 获取下一个词
    # 根据第一个词的长度来定位第二个词的位置
    if len(text) == 1:
        offset = 27
    elif len(text) == 2:
        offset = 47
    else:
        offset = 60
    text = get_text(img, offset=offset)
    label2 = -1
    if text.mean() < 0.95:
        label2 = word_model.predict(text)
        label2 = label2.argmax()
        text = texts[label2]

    # 加载图片分类器
    labels = img_model.predict(imgs)
    labels = labels.argmax(axis=1)
    positions = []
    for pos, label in enumerate(labels):
        if label==label1 or label==label2:
            positions.append(pos+1)
    print(positions)
    del label,labels,img,imgs
    gc.collect()
    return positions

if __name__ == '__main__':
    for i in range(100000):
        captcha_predict("")
else:
    captcha_predict("")
